import React from "react";

import "./styles/PlaceInfoContainer.css";

export default function PlaceInfoCard ({placeName, placeDays}){
    return(
        <>
        <div className="placeCard">
            <div className="placeName">{placeName}</div>
            <div className="placeDays">{placeDays}</div>
            <button className="placeCardDeleteBtn">Delete</button>
        </div>
        </>
    );
}
